const features = require('./features');

describe('generateLovePercent', () => {
  let originalMathRandom;

  beforeAll(() => {
    originalMathRandom = Math.random;
  });

  afterEach(() => {
    Math.random = originalMathRandom;
  });

  test('should return a string ending with %', () => {
    Math.random = jest.fn().mockReturnValue(0.5);
    const result = features.generateLovePercent();
    expect(typeof result).toBe('string');
    expect(result).toMatch(/%$/);
  });

  test('should return 0% when Math.random returns 0', () => {
    Math.random = jest.fn().mockReturnValue(0);
    const result = features.generateLovePercent();
    expect(result).toBe('0%');
  });

  test('should return 99% when Math.random returns a value close to 1', () => {
    Math.random = jest.fn().mockReturnValue(0.9999);
    const result = features.generateLovePercent();
    expect(result).toBe('99%');
  });
});
